import { faFacebook, faGithub, faLinkedin } from "@fortawesome/free-brands-svg-icons";
import { faGift } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import React, { Component } from "react";
import fb from "../../assets/fb.svg";
import git from "../../assets/git.svg";
import gmail from "../../assets/gmail.svg";
import linkedin from "../../assets/linkedin.svg";

import "./Footer.scss";

class Footer extends Component {
	render() {
		return (
			<div className="Footer">
				<div className="get_In_touch">Get in touch</div>
				<div className="contact">
					<div className="fb">
						<a href="https://www.facebook.com/profile.php?id=100007399969441">
							{/* <img src={fb} alt="fb" className="icon" /> */}
							<FontAwesomeIcon icon={faFacebook} />
						</a>
					</div>
					<div className="lin">
						<a href="https://www.linkedin.com/in/kanan-mikayilov-9759aa160/">
							{/* <img src={linkedin} alt="linkedin" className="icon" /> */}
							<FontAwesomeIcon icon={faLinkedin} />
						</a>
					</div>
					<div className="mail">
						<a href="mailto:kenan.mikayilov.00@gmail.com">
							{/* <img src={gmail} alt="gmail" className="icon gmail" /> */}
							{/* <FontAwesomeIcon icon={faEmai} /> */}
						</a>
					</div>
					<div className="git">
						<a href="https://github.com/KananM10">
							{/* <img src={git} alt="git" className="icon" /> */}
							<FontAwesomeIcon icon={faGithub} />
						</a>
					</div>
				</div>
			</div>
		);
	}
}

export default Footer;

